RATES, AMENITIES and OTHERS
Good day! This is Serenity Farm and Resort Busay. Thank you for your interest in our property.

______________________________
HOUSE-1:
- Overnight Php17,000.00 (Inclusive of 1-16 guests);
- Exclusive use of the swimming pool;
- Php350.00/head* - additional guests staying overnight;
- More than 25 guests is suggested to get another house/room for more comfortable stay;
- Php175.00/head - guests staying during the day only. Day-Use (2PM-8PM or 6AM-12PM);
- No limit with the number of Day-Use guests;
- SECURITY BOND is a MUST (Php5,000.00 Refundable).

______________________________
HOUSE-2**:
- Overnight Php10,000.00 (Inclusive of 1-8 guests);
- Php350.00/head* - additional guests staying overnight;
- More than 12 guests is suggested to get another house/room for more comfortable stay;
- Php175.00/head - guests staying during the day only. Day-Use (2PM-8PM or 6AM-12PM);
- No limit with the number of Day-Use guests;
- SECURITY BOND is a MUST (Php5,000.00 Refundable).

______________________________
HOUSE-3 (Consists of 2 Villas):
- Overnight Php15,000.00 (Inclusive of 1-14 guests);
- Exclusive use of a swimming pool;
- Php350.00/head* - additional guests staying overnight;
- More than 20 guests is suggested to get another house/room for more comfortable stay;
- Php175.00/head - guests staying during the day only. Day-Use (2PM-8PM or 6AM-12PM);
- No limit with the number of Day-Use guests;
- SECURITY BOND is a MUST (Php5,000.00 Refundable).

House-3 VILLA 1 only:
- Overnight Php10,000.00 (Inclusive of 1-10 guests);
- Mondays to Thursdays only;
- Subject to availability within the rental week.

House-3 VILLA 2 only:
- Overnight Php7,000.00 (Inclusive of 1-7 guests);
- Mondays to Thursdays only;
- Subject to availability within the rental week.

Renters of the 2 villas will share the swimming pool.

______________________________
PROMO:
HOUSE-2** plus four addâl individual rooms
- Overnight Php16,000.00 (Inclusive of 1-16 guests);
- Free use of Karaoke.
SAVE Php6,000.00

ROOM only:
- Overnight Php2,500.00 (1-2 guests);
- Subject to availability within the rental week;
- No swimming pool. 

______________________________
We give our clients the flexibility to choose the available accommodations they like. A single accommodation rental is inclusive of a number of guests that can enter the resort without extra cost. It is at the discretion of the client to make the best of the number of inclusive guests. That being so, if there are more guests expected besides the inclusive guests, then we will put in added charges as necessary.

______________________________
* Additional Overnight Guests:
The charge for the additional guest covers only the overnight entrance fee. It does not include additional mattress/beddings and towel sets. The guests can bring their own beddings and towel sets at no extra cost.

______________________________
50 guests or more staying in only one house will be charged additional Php3,000 for utilities. 

______________________________
CHECK-IN TIME: Not earlier than 2:00PM
CHECK-OUT TIME: Not later than 12:00PM

______________________________
FREE
Maximum of 4 Qualified Individuals per House.
Qualifications:
A. Children 8 years old and below;
B. Senior citizens;
C. Combination of A and B (equivalent to 4 individuals only).

______________________________
DAY-USE
- Required HOUSE rental (w/ inclusive number of guests) + (optional) additional guests;
- Time Slot Selection: 2PM-8PM or 6AM-12PM;
- Available from Sundays to Fridays. Subject to availability within the rental week;
- Reservation is necessary as walk-in guests are only accepted when there's vacancy;
- SECURITY BOND is a MUST (Php5,000.00 Refundable).

Rates per Time Slot:
House-1 (1-16 guests): Php10,000.00
House-2** (1-8 guests): Php5,000.00
House-2** plus 4 rooms (1-16 guests): Php8,000.00
House-3 (1-14 guests): Php8,000.00
House-3 Villa-1 (1-10 guests): Php5,000
House-3 Villa-2 (1-7 guests): Php4,000

